import React from 'react';
import { useParams } from 'react-router-dom';
import ShoesForm from '../../components/Form/index';

const PagesShoesForm = () => {
  const { id } = useParams();

  return (

    <ShoesForm id={id ? Number.parseInt(id, 10) : null} />

  );
}

export default PagesShoesForm;
